INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(1, 'Panthera pardus nimr', 'Arabian Leopard', 'Arabian Leopard', 1, 'The Arabian leopard (Panthera pardus nimr) is a leopard subspecies native to the Arabian Peninsula and classified as Critically Endangered by IUCN since 1996. Fewer than 200 wild individuals were estimated to be alive in 2006. The population comprises fewer than 250 mature individuals and is severely fragmented. Subpopulations are isolated and not larger than 50 mature individuals. The population is thought to decline continuously.\r\n\r\nThe Arabian leopard is the smallest leopard subspecies. It was tentatively affirmed as a distinct subspecies by genetic analysis from a single captive leopard from Israel of south Arabian origin, which appeared most closely related to the African leopard.', 'less than 200 in the wild', 1, 0, 1, 0, '', '', '', '', , '', 'carnivore', '', 1, '2015-03-11', '2015-03-16');
INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(3, 'Arabitragus jayakari', 'Arabian Tahr', 'Arabian Tahr', 4, 'The Arabian tahr is the smallest species of tahr. The animal is of stocky build with backward-arching horns in both sexes. Males are much more robust than females. Its coat consists of a long, reddish-brown hair, with a dark stripe running down the back. Males possess the most impressive manes which extend right down the back and grow longer, based on the age. In the oldest males the muzzle darkens to black and the eye stripes also darken. As with most mountain goats and sheep, it has rubbery hooves to provide balance and traction on the steep, rocky slopes.\r\n', '', 1, 0, 1, 0, '', '', 'The Arabian tahr is endangered due to intense overgrazing, poaching, and habitat destruction. In Oman, a recent increase of human migration to urban areas has resulted in domestic goats becoming feral and foraging in places which were once strictly the tahr''s home. Habitat degradation is also another major threat, due to construction of roads, buildings, and mineral extraction. Also, poaching often occurs when the animals descend down from the mountains for a fresh drink.\r\n', '', , '', 'Herbivore', 'These animals are usually browsers, feeding on grass, shrubs, leaves, and fruits of most trees. They are highly dependent on water and need to drink every two or three days during summer. They would descend from their point of elevation to drink from river courses known as wadis, and would travel to new areas when water dries up.\r\n', 1, '2015-03-15', NULL);
INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(4, 'Uromastyx', 'Spiny Tailed Lizard', 'Spiny Tailed lizard', 5, 'Uromastyx is a genus of African and Asian agamid lizard whose members are better-known as spiny-tailed lizards, uromastyces, mastigures, or dabb lizards. Uromastyx are primarily herbivorous, but occasionally eat insects, especially when young. They spend most of their waking hours basking in the sun, hiding in underground chambers at daytime or when danger appears. They tend to establish themselves in hilly, rocky areas with good shelter and accessible vegetation.', '', 1, 0, 1, 0, '', '', '', '', , '', 'vegetation', 'These lizards acquire most of the water they need from the vegetation they ingest.Giving a Uromastyx a water bowl can lead to higher humidity in the cage and can cause problems for the animal.', 1, '2015-03-16', '2015-03-16');
INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(5, 'Camelus dromedarius', 'Camel', 'Camel', 5, 'The dromedary  also called the Arabian camel  -Camelus dromedarius), is a large, even-toed ungulate with one hump on its back.', '', 1, 1, 0, 0, 'Dromedaries are used as beasts of burden in most of their domesticated range. Unlike horses, they kneel for the loading of passengers and cargo. A camel can carry an estimated 159–295 kg (351–650 lb) for 24 km (15 mi) for a long time. Camels can be trained to bear loads from five years of age, but must not be given a large load until six years old. Camels are usually patient animals, easier to train and tougher than cattle. Camels can also be used to pull carts, plows, and draw wheels. A dromedary can plow at a speed of 2.5 km (1.6 mi) per hour, but must not be worked for more than six hours a day. Their hair is durable and light, so it is used as a source material for woven goods, ranging from Bedouin tents to garments. The hair is clipped off using hand shears, or sometimes simply pulled, after which the camel''s body is oiled. Juveniles less than two years of age have a fine undercoat, which is also used for these purposes. They also give wool. The wool produce of a herd of 4300 dromedaries in Russia in 1970 and 1974 was 557 kg (1,228 lb) and 576 kg (1,270 lb), respectively.', '', '', '', , '', 'accasia tree', 'The diet of the camel mostly consists of foliage, dry grasses, and available desert vegetation, mostly thorny plants growing in the camel''s natural habitat. These comprise 70% of their diet in summer and 90% in winter. In the Sahara, 332 plant species have been recorded for the dromedary. The dromedary will feed on Acacia, Artiplex, and Salsola plants whenever available.\r\n\r\nThey keep their mouths open while chewing thorny food. They use their lips to grasp the food, then chew each bite 40-50 times. Features like long eyelashes, eyebrows, lockable nostrils, caudal opening of the prepuce and a relatively small vulva help the camel avoid injuries, especially while feeding.', 1, '2015-03-16', '2015-03-21');
INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(6, 'Acasia', 'Acacia tree, Thorntree, Whistling Thorn, Wattle', 'Acacia tree', 6, 'Acacia (əˈkeɪʃə or əˈkeɪsiə), known commonly as acacia, thorntree, whistling thorn, or wattle, is a genus of shrubs and trees belonging to the subfamily Mimosoideae of the family Fabaceae, described by the Swedish botanist Carl Linnaeus in 1773 based on the African species Acacia nilotica. Many non-Australian species tend to be thorny, whereas the majority of Australian acacias are not. All species are pod-bearing, with sap and leaves often bearing large amounts of tannins and condensed tannins that historically found use as pharmaceuticals and preservatives. The generic name derives from ἀκακία (akakia), the name given by early Greek botanist-physician Pedanius Dioscorides (middle to late first century) to the medicinal tree A. nilotica in his book Materia Medica. This name derives from the Greek word for its characteristic thorns, ἀκίς (akis; "thorn"). The species name nilotica was given by Linnaeus from this tree''s best-known range along the Nile river.', '', 1, 0, 0, 1, '', '', '', '', , '', '', '', 1, '2015-03-16', '2015-03-21');
INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(7, 'Thunnini', 'Tuna', 'Tuna', 8, 'A tuna is a saltwater finfish that belongs to the tribe Thunnini, a sub-grouping of the mackerel family (Scombridae) – which together with the tunas, also includes the bonitos, mackerels, and Spanish mackerels. Thunnini comprises fifteen species across five genera, the sizes of which vary greatly, ranging from the bullet tuna (max. length: 50 cm (1.6 ft), weight: 1.8 kg (4 lb)) up to the Atlantic bluefin tuna (max. length: 4.6 m (15 ft), weight: 684 kg (1,508 lb)). The bluefin averages 2 m (6.6 ft), and is believed to live for up to 50 years.\r\n\r\nTheir circulatory and respiratory systems are unique among fish, enabling them to maintain a body temperature higher than that of the surrounding water. An active and agile predator, the tuna has a sleek, streamlined body, and is among the fastest-swimming pelagic fish –  the yellowfin tuna, for example, is capable of speeds of up to 75 km h (47 mph). Found in warm seas, it is extensively fished commercially, and is popular as a game fish. As a result of over-fishing, stocks of some tuna species such as the Southern bluefin tuna have been reduced dangerously close to the point of extinction.', '', 1, 0, 0, 0, '', '', '', '', , '', '', '', 1, '2015-03-16', '2015-03-21');
INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(8, 'Xiphias gladius', 'Swordfish', 'Swordfish', 8, 'Swordfish (Xiphias gladius; from Greek ξίφος: sword, and Latin gladius: sword), also known as broadbills in some countries, are large, highly migratory, predatory fish characterized by a long, flat bill. They are a popular sport fish of the billfish category, though elusive. Swordfish are elongated, round-bodied, and lose all teeth and scales by adulthood. These fish are found widely in tropical and temperate parts of the Atlantic, Pacific, and Indian Oceans, and can typically be found from near the surface to a depth of 550 m (1,800 ft). They commonly reach 3 m (9.8 ft) in length, and the maximum reported is 4.55 m (14.9 ft) in length and 650 kg (1,430 lb) in weight.', '', 1, 0, 0, 0, '', '', '', '', , '', '', '', 1, '2015-03-16', '2015-03-21');
INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(9, ' Lutjanus campechanus', 'red snapper', 'red snapper', 9, 'The northern red snapper''s body is very similar in shape to other snappers, such as the mangrove snapper, mutton snapper, lane snapper, and dog snapper. All feature a sloped profile, medium-to-large scales, a spiny dorsal fin, and a laterally compressed body. Northern red snapper have short, sharp, needle-like teeth, but they lack the prominent upper canine teeth found on the mutton, dog, and mangrove snappers. This snapper reaches maturity at a length of about 39 cm (15 in). The common adult length is 60 cm (24 in), but may reach 100 cm (39 in). The maximum published weight is 38.5 kg (85 lb), and the oldest reported age is 100 + years. Coloration of the northern red snapper is light red, with more intense pigment on the back. It has 10 dorsal spines, 14 soft dorsal rays, three anal spines and eight to 9 anal soft rays. Juvenile fish (shorter than 30–35 cm) can also have a dark spot on their sides, below the anterior soft dorsal rays, which fades with age.', '', 1, 0, 0, 0, '', '', '', '', , '', '', '', 1, '2015-03-16', '2015-03-21');
INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(10, 'Ardea cinerea', 'Grey Heron', 'Grey Heron', 10, 'It is a large bird, standing up to 100 cm  tall and measuring 102 cm  long with a 195 cm wingspan. Its plumage is largely grey above, and off-white below. Adults have a white head with a broad black supercilium and slender crest, while immatures have a dull grey head. It has a powerful, pinkish-yellow bill, which is brighter in breeding adults. It has a slow flight, with its long neck retracted (S-shaped). This is characteristic of herons and bitterns, and distinguishes them from storks, cranes and spoonbills, which extend their necks. The call is a loud croaking "fraaank". ', '', 1, 0, 0, 0, '', '', '', '', , '', 'fish', '', 1, '2015-03-16', '2015-03-16');
INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(11, 'Mangrove', 'Mangrove', 'Mangrove', 12, 'Mangroves are various large and extensive types of trees up to medium height and shrubs that grow in saline coastal sediment habitats in the tropics and subtropics—mainly between latitudes 25° N and 25° S. The remaining mangrove forest areas of the world in 2000 was 53,190 square miles (137,760 km²) spanning 118 countries and territories.\r\n\r\nThe word is used in at least three senses:  most broadly to refer to the habitat and entire plant assemblage or mangal,for which the terms mangrove forest biome, mangrove swamp and mangrove forest are also used, to refer to all trees and large shrubs in the mangrove swamp, and (3) narrowly to refer to the mangrove family of plants, the Rhizophoraceae, or even more specifically just to mangrove trees of the genus Rhizophora.\r\n\r\nThe mangrove biome, or mangal, is a distinct saline woodland or shrubland habitat characterized by depositional coastal environments, where fine sediments (often with high organic content) collect in areas protected from high-energy wave action. The saline conditions tolerated by various mangrove species range from brackish water, through pure seawater (30 to 40 ppt (parts per thousand)), to water concentrated by evaporation to over twice the salinity of ocean seawater (up to 90 ppt).', '', 1, 0, 0, 0, '', '', '', '', , '', '', '', 1, '2015-03-16', '2015-03-21');
INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(12, 'Apis', 'Honey bee', 'Honet bee', 13, 'A honey bee (or honeybee) is any member of the genus Apis, primarily distinguished by the production and storage of honey and the construction of perennial, colonial nests from wax. Honey bees are the only extant members of the tribe Apini, all in the genus Apis. Currently, only seven species of honey bee are recognized, with a total of 44 subspecies,[1] though historically, from six to eleven species have been recognised. Honey bees represent only a small fraction of the roughly 20,000 known species of bees. Some other types of related bees produce and store honey, but only members of the genus Apis are true honey bees. The study of honey bees is known as apiology.', '', 1, 0, 0, 0, 'Polination', 'pesticides', '', '', , '', '', '', 1, '2015-03-16', '2015-03-16');
INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(13, 'Merops', 'Bee eater', 'Bee eater', 15, 'The bee-eaters are a group of near-passerine birds in the family Meropidae. Most species are found in Africa and Asia but others occur in southern Europe, Australia, and New Guinea. They are characterised by richly coloured plumage, slender bodies, and usually elongated central tail feathers. All have long downturned bills and pointed wings, which give them a swallow-like appearance when seen from afar. There are 26 different species of bee-eaters.\r\n\r\nAs the name suggests, bee-eaters predominantly eat flying insects, especially bees and wasps, which are caught in the air by sallies from an open perch. While they pursue any type of flying insect, honey bees predominate in their diet. Hymenoptera (ants, bees and wasps) comprise from 20% to 96% of all insects eaten, with honey bees comprising approximately one-third of the Hymenoptera.\r\n\r\nBefore eating its meal, a bee-eater removes the stinger by repeatedly hitting and rubbing the insect on a hard surface. During this process, pressure is applied to the insect thereby extracting most of the venom. Notably, the birds only catch prey that are on the wing and ignore flying insects once they land.\r\n\r\nBee-eaters are gregarious. They form colonies by nesting in burrows tunnelled into the side of sandy banks, such as those that have collapsed on the edges of rivers. Their eggs are white and they generally produce 2–9 eggs per clutch (depending on species). As they live in colonies, large numbers of these holes are often seen together, white streaks from their accumulated droppings accentuating the entrances to the nests. Most of the species in the family are monogamous, and both parents care for the young, sometimes with the assistance of other birds in the colony, a behavior considered unusual for birds.', '', 1, 0, 0, 0, '', '', '', '', , '', '', '', 1, '2015-03-16', '2015-03-21');

