INSERT INTO `subfamily` (`subfamily_id`, `family_id`, `subfamily_name`, `subfamily_description`) VALUES
(1, 2, 'Felidae', ''),
(4, 2, 'Bovidae', 'The Bovidae are the biological family of cloven-hoofed, ruminant mammals that includes bison, African buffalo, water buffalo, antelopes, gazelles, sheep, goats, muskoxen, and domestic cattle. A member of this family is called a bovid. Consisting of 143 extant species and 300 known extinct species, the family Bovidae consists of eight major subfamilies apart from the disputed Peleinae and Pantholopinae. The family evolved some 20 million years ago, in the early Miocene.\r\nAll bovids have the similar basic form - a snout with a blunt end, a pair of horns (generally present on males) immediately after the oval or pointed ears, a distinct neck and limbs, and a tail varying in length and bushiness among the species.The bovids show great variation in size and pelage colouration. Excepting some domesticated forms, all male bovids have horns, and in many species females possess horns too. The size and shape of the horns vary greatly, but the basic structure is always a pair of simple bony protrusions without branches, often having a spiral, twisted or fluted form, each covered in a permanent sheath of keratin. Most bovids bear 30 to 32 teeth.'),
(5, 4, 'Agamidae', ''),
(6, 8, 'Camelidae', 'Camelids are large animals with slender necks and long legs, and are strictly herbivorous. They differ from ruminants in a number of ways.  Their dentition show traces of vestigial central incisors in the upper jaw, and the third incisors are developed into canine-like tusks. Camelids also have true canine teeth and tusk-like premolars, which are separated from the molars by a gap. The musculature of the hind limbs differs from those of other ungulates in that the legs are attached to the body only at the top of the thigh, rather than attached by skin and muscle from the knee upwards. Because of this, camelids have to lie down by resting on their knees with their legs tucked underneath their bodies. They have three-chambered stomachs, rather than four-chambered ones; their upper lips are split in two, with each part separately mobile; and, uniquely among mammals, their red blood cells are elliptical.They also have a unique type of antibodies, lacking the light chain, in addition to the normal antibodies found in other mammals. These so-called heavy-chain antibodies are being used to develop single-domain antibodies with potential pharmaceutical applications.\r\n\r\nThey do not have hooves, rather they have two-toed feet with toenails and soft foot pads. The main weight of the animal is borne by these tough, leathery sole pads. The South American camelids, adapted to steep and rocky terrain, can move the pads on their toes to maintain grip. Many fossil camelids were unguligrade and probably hooved, in contrast to all living species.\r\n\r\nCamelids are behaviorally similar in many ways, perhaps most notably in their walking gait during which both legs on the same side are moved simultaneously. The consequent swaying motion of camelids large enough for human beings to ride is legendary.'),
(7, 8, 'Fabaceae', 'The Fabaceae or Leguminosae,[6] commonly known as the legume, pea, or bean family, are a large and economically important family of flowering plants. It includes trees, shrubs, and herbaceous plants perennials or annuals, which are easily recognized by their fruit (legume) and their compound, stipulated leaves. The group is widely distributed and is the third-largest land plant family in terms of number of species, behind only the Orchidaceae and Asteraceae, with 630 genera and over 18,860 species.[7][8] The five largest of the 630 legume genera are Astragalus (over 2,000 species), Acacia (over 1000 species), Indigofera (around 700 species), Crotalaria (around 700 species), and Mimosa (around 500 species), which constitute about a quarter of all legume species. About 18,000 legume species are known, amounting to about 7% of flowering plant species.[7][9] Fabaceae is the most common family found in tropical rainforests and in dry forests in the Americas and Africa.[10]\r\n\r\nRecent molecular and morphological evidence supports the fact that the Fabaceae are a single monophyletic family. This point of view has been supported not only by the degree of interrelation shown by different groups within the family compared with that found among the Leguminosae and their closest relations, but also by all the recent phylogenetic studies based on DNA sequences. These studies confirm that the Leguminosae are a monophyletic group that is closely related with the Polygalaceae, Surianaceae and Quillajaceae families and that they belong to the order Fabales.\r\n\r\nAlong with the cereals, some fruits and tropical roots a number of Leguminosae have been a staple human food for millennia and their use is closely related to human evolution.'),
(8, 7, 'Scombridae', 'Scombridae is the family of the mackerels, tunas, and bonitos, so includes many of the most important and familiar food fishes. The family consists of 51 species in 15 genera and two subfamilies. All species are in the subfamily Scombrinae, except the butterfly kingfish - which is the sole member of subfamily Gasterochismatinae.[1]\r\n\r\nScombrids have two dorsal fins, and a series of finlets behind the rear dorsal fin and anal fin. The caudal fin is strongly divided and rigid, with a slender, ridged base. The first (spiny) dorsal fin and the pelvic fins are normally retracted into body grooves. Species lengths vary from the 20 cm (7.9 in) of the island mackerel to the 4.58 m (15.0 ft) recorded for the immense Atlantic bluefin tuna.\r\n\r\nScombrids are generally predators of the open ocean, and are found worldwide in tropical and temperate waters. They are capable of considerable speed, due to a highly streamlined body and retractable fins. Some members of the family, in particular the tunas, are notable for being partially endothermic (warm-blooded), a feature that also helps them to maintain high speed and activity. Other adaptations include a large amount of red muscle, allowing them to maintain activity over long periods. Two of the fastest recorded scombrids are the wahoo and the yellowfin tuna, which can each attain speeds of 75 km/h .'),
(9, 7, 'Xiphiidae', ''),
(10, 7, 'Lutjanidae', 'Snappers are a family of perciform fish, Lutjanidae, mainly marine, but with some members inhabiting estuaries, feeding in fresh water. Some are important food fish. One of the best known is the red snapper.\r\n\r\nSnappers inhabit tropical and subtropical regions of all oceans. They can grow to about 1 m (3.3 ft) in length. Most are active carnivores, feeding on crustaceans or other fish,[2] though a few are plankton-feeders. They can be kept in aquaria, but mostly grow too fast to be popular aquarium fish. Most species live at depths reaching 100 m (330 ft) near coral reefs, but some species are found up to 500 m (1,600 ft) deep.[2]\r\n\r\n\r\nFive-lined snapper northeast coast of Taiwan\r\n\r\nLutjanus vitta (brown striped snapper) sold at a supermarket\r\nAs other fish, snappers harbour parasites. A detailed study conducted in New Caledonia has shown that coral reef-associated snappers harbour about 9 species of parasites per fish species.'),
(11, 3, 'Ardeidae', 'The herons are long-legged freshwater and coastal birds in the family Ardeidae, with 64 recognised species (some are called "egrets" or "bitterns" instead of "heron"). Within Ardeidae, all members of the genera Botaurus and Ixobrychus are referred to as "bitterns", and — including the zigzag heron or zigzag bittern — are a monophyletic group within the Ardeidae. However, egrets are not a biologically distinct group from the herons, and tend to be named differently because they are mainly white or have decorative plumes. Although egrets have the same build as herons, they tend to be smaller.\r\n\r\nThe classification of the individual heron/egret species is fraught with difficulty, and there is still no clear consensus about the correct placement of many species into either of the two major genera, Ardea and Egretta. Similarly, the relationship of the genera in the family is not completely resolved. However, one species formerly considered to constitute a separate monotypic family Cochlearidae, the boat-billed heron, is now regarded as a member of the Ardeidae.\r\n\r\nAlthough herons resemble birds in some other families, such as the storks, ibises, spoonbills and cranes, they differ from these in flying with their necks retracted, not outstretched. They are also one of the bird groups that have powder down. Some members of this group nest colonially in trees, while others, notably the bitterns, use reed beds.'),
(12, 9, 'Rhizophoraceae', 'Rhizophoraceae is a family constituted by tropical or subtropical flowering plants. Among the better-known members are mangrove trees of the genus Rhizophora. There are around 149 species distributed in sixteen genera, most native to the Old World.\r\nThese are woody plants with opposite or whorled leaves (but not decussate), with insect-pollinated flowers having a nectary disc and typically five petals. This family is now placed in the order Malpighiales, though under the Cronquist system they formed an order in themselves (Rhizophorales).\r\n\r\nThese species are often hermaphrodite, more rarely polygamomonoecious. Mangrove species are usually viviparous while those living on land are not.'),
(13, 6, 'Apini', ''),
(14, 9, 'Meropidae', ''),
(15, 10, ' Nyctyornis', '');

